import{_ as r,a as e,b as l,c as i,d as a,e as o,f as n,g as s,h,i as p,j as c}from"./chunks/airlink-reference-design.BXEk6JF_.js";import{_ as T,c as k,o as m,ab as d,m as t}from"./chunks/framework.CUflZczI.js";const M=JSON.parse('{"title":"Sky-Drones AIRLink","description":"","frontmatter":{},"headers":[],"relativePath":"uk/flight_controller/airlink.md","filePath":"uk/flight_controller/airlink.md"}'),b={name:"uk/flight_controller/airlink.md"},_=d('<h1 id="sky-drones-airlink" tabindex="-1">Sky-Drones AIRLink <a class="header-anchor" href="#sky-drones-airlink" aria-label="Permalink to &quot;Sky-Drones AIRLink&quot;">​</a></h1><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>PX4 не виробляє цей (або будь-який інший) автопілот. Зверніться до <a href="https://sky-drones.com/" target="_blank" rel="noreferrer">виробника</a> щодо підтримки обладнання або питань сумісності.</p></div><p><a href="https://sky-drones.com/airlink" target="_blank" rel="noreferrer">AIRLink</a> розшифровується як Artificial Intelligence (штучний інтелект) &amp; Remote Link (дистанційне з&#39;єднання). Апарат складається з найсучаснішого автопілота безпілотника, комп&#39;ютера зі штучним інтелектом та блоку зв&#39;язку LTE/5G. AIRLink допомагає скоротити час виходу на ринок для нових виробників дронів з років і місяців до тижнів.</p><p><img src="'+r+'" alt="AIRLink"></p><p>:::note Цей польотний контролер підтримується <a href="./../flight_controller/autopilot_manufacturer_supported.html">виробником</a>. :::</p><p>AIRLink має два комп&#39;ютери та інтегрований LTE-модуль:</p><ul><li>Комп&#39;ютер керування польотом (автопілот) має потрійне резервування з вібро- та термостабілізованим IMU.</li><li>Потужний місійний комп&#39;ютер зі штучним інтелектом забезпечує такі передові функції програмного забезпечення безпілотника, як комп&#39;ютерний зір і оминання перешкод, потокове передавання цифрового відео високої чіткості та потокове передавання даних корисного вантажу.</li><li>Модулі зв&#39;язку LTE/5G та WiFi забезпечують постійне широкосмугове підключення до Інтернету, що дозволяє здійснювати віддалені робочі процеси.</li></ul><h2 id="основні-характеристики" tabindex="-1">Основні характеристики <a class="header-anchor" href="#основні-характеристики" aria-label="Permalink to &quot;Основні характеристики&quot;">​</a></h2>',8),S=t("p",null,[t("div",{class:"embed-responsive embed-responsive-16by9"},[t("iframe",{class:"embed-responsive-item youtube-player",type:"text/html",width:"640",height:"390",src:"https://www.youtube.com/embed/VcBx9DLPN54",frameborder:"0",webkitallowfullscreen:"",mozallowfullscreen:"",allowfullscreen:""})])],-1),A=d('<h2 id="специфікаціі" tabindex="-1">Специфікації <a class="header-anchor" href="#специфікаціі" aria-label="Permalink to &quot;Специфікації&quot;">​</a></h2><ul><li><p><strong>Датчики (сенсори)</strong></p><ul><li>3x акселерометри, 3x гіроскопи, 3x магнітометри, 3x датчики тиску</li><li>ГНСС, далекоміри, лідари, оптичний потік, камери</li><li>3x-кратне резервування IMU</li><li>Гасіння вібрації</li><li>Стабілізація температури</li></ul></li><li><p><strong>Політний контролер</strong></p><ul><li>STM32F7, ARM Cortex M7 з FPU, 216 МГц, 2 МБ Flash, 512 кБ оперативної пам&#39;яті</li><li>STM32F1, співпроцесор вводу/виводу (IO)</li><li>Ethernet, 10/100 Мбіт/с</li><li>Локальна мережа з комп&#39;ютером місії зі штучним інтелектом</li><li>8x UART: Телеметрія 1, Телеметрія 2 ( місійний комп&#39;ютер зі ШІ), Телеметрія 3, GPS 1, GPS 2, додатковий UART, послідовна консоль налагодження, ввід-вивід (IO)</li><li>2x CAN: CAN1, CAN2</li><li>USB з MAVLink</li><li>Послідовна консоль для відладки</li><li>Вхід RC, вхід SBUS, вхід RSSI, вхід PPM</li><li>16x PWM виходів сервоприводів (8 з IO, 8 з FMU)</li><li>3x I2C порти</li><li>Потужний драйвер п&#39;єзо-зуммера</li><li>Високопотужний RGB LED</li><li>Запобіжний вимикач / LED опція</li></ul></li><li><p><strong>Місійний комп&#39;ютер зі штучним інтелектом</strong></p><ul><li>6-ядерний процесор: двоядерний Cortex-A72 + чотирьохядерний Cortex-A53</li><li>Графічний процесор Mali-T864, OpenGL ES1.1/2.0/3.0/3.1</li><li>VPU з декодуванням 4K VP8/9, 4K 10bits H265/H264 60fps</li><li>Дистанційне керування живленням, скидання програмного забезпечення, вимкнення живлення, пробудження RTC, сплячий режим</li><li>Оперативна пам&#39;ять Dual Channel 4GB LPDDR4</li><li>16GB eMMC</li><li>MicroSD до 256 Гб</li><li>Ethernet 10/100/1000 Native Gigabit</li><li>WiFi 802.11a/b/g/n/ac, Bluetooth</li><li>USB 3.0 Type C</li><li>2х Video: 4-смугова MIPI CSI (FPV-камера) та 4-смугова MIPI CSI з входом HMDI (камера корисного навантаження)</li></ul></li><li><p><strong>Модуль зв&#39;язку LTE/5G</strong></p><ul><li>Пропускна здатність до 600 Мбіт/с</li><li>5G sub-6 і mmWave, SA і NSA операції</li><li>4G Cat 20, до 7xCA, 256-QAM DL/UL, 2xCA UL</li><li>4 x 4 MIMO для 4G і 5G (до 6 діапазонів)</li><li>3G HSPA+</li><li>Схвалено JRL/JTBL, FCC, PTCRB, RED, GCF</li><li>Антена, 4x4 MIMO</li><li>Bands: Worldwide</li></ul></li></ul><h2 id="де-купити" tabindex="-1">Де купити <a class="header-anchor" href="#де-купити" aria-label="Permalink to &quot;Де купити&quot;">​</a></h2><p>Купуйте в оригінальному магазині Sky-Drones (доставка по всьому світу з обробкою замовлення за 1-2 дні):</p><ul><li><a href="https://sky-drones.com/sets/airlink-enterprise-set.html" target="_blank" rel="noreferrer">AIRLink Enterprise 4G</a></li><li><a href="https://sky-drones.com/sets/airlink-5g-enterprise-set.html" target="_blank" rel="noreferrer">AIRLink Enterprise 5G</a></li><li><a href="https://sky-drones.com/autopilots/airlink-core.html" target="_blank" rel="noreferrer">AIRLink Core 4G</a></li><li><a href="https://sky-drones.com/store/airlink-5g-core.html" target="_blank" rel="noreferrer">AIRLink Core 5G</a></li></ul><h2 id="аксесуари-до-airlink-enterprise-kit" tabindex="-1">Аксесуари до AIRLink Enterprise Kit <a class="header-anchor" href="#аксесуари-до-airlink-enterprise-kit" aria-label="Permalink to &quot;Аксесуари до AIRLink Enterprise Kit&quot;">​</a></h2>',6),u=t("p",null,[t("div",{class:"embed-responsive embed-responsive-16by9"},[t("iframe",{class:"embed-responsive-item youtube-player",type:"text/html",width:"640",height:"390",src:"https://www.youtube.com/embed/lex7axW8WQg",frameborder:"0",webkitallowfullscreen:"",mozallowfullscreen:"",allowfullscreen:""})])],-1),I=d('<p>AIRLink Enterprise прибуває з усім необхідним для налаштування автопілота.</p><p>Стандартний набір містить:</p><ul><li>1x AIRLink Enterprise unit</li><li>1x FPV камера з CSI кабелем</li><li>1x WiFi антена з роз&#39;ємом MMCX</li><li>2x/4x LTE/5G антена з роз&#39;ємом MMCX</li><li>1x кабель HDMI на міні HDMI 1x набір кабелів (7 кабелів для всіх роз&#39;ємів)</li></ul><p><a href="https://sky-drones.com/sets/airlink-telemetry-set.html" target="_blank" rel="noreferrer">AIRLink Telemetry</a> на базі радіочастотного мікромодуля Microhard LAN/IP доступний як додатковий модуль і повністю сумісний з AIRLink.</p><h2 id="видання" tabindex="-1">Видання <a class="header-anchor" href="#видання" aria-label="Permalink to &quot;Видання&quot;">​</a></h2><p>Існують версії AIRLink, які пропонують різні рівні інтеграції, необхідні виробникам дронів: <em>Enterprise</em> та <em>Core</em>. AIRLink Enterprise ідеально підходить для швидкого старту, оцінки та створення прототипів, тоді як Core оптимізовано для глибокої інтеграції та середньо- і крупносерійного виробництва.</p><p><strong>AIRLink Enterprise</strong></p><p>Корпоративна версія SmartAP AIRLink призначена для створення прототипів та виробництва дронів у малих та середніх обсягах. Швидкий і простий процес підключення завдяки спеціальним монтажним отворам і вбудованому тепловідводу для розсіювання енергії.</p><p><img src="'+e+'" alt="AIRLink Enterprise"></p><p><strong>AIRLink Core</strong></p><p>Версія SmartAP AIRLink Core призначена для середніх і великих обсягів виробництва та глибокої інтеграції з обладнанням замовника. Він важить лише 89 г і може бути прикріплений до металевої рами для оптимального охолодження.</p><p><img src="'+l+'" alt="AIRLink Core"></p><table><thead><tr><th>Параметр</th><th>AIRLink Enterprise</th><th>AIRLink Core</th></tr></thead><tbody><tr><td>Корпус</td><td>Алюмінієвий, з інтегрованим тепловідводом і можливістю встановлення вентилятора.</td><td>Зовнішній тепловідвід або достатнє розсіювання тепла повинно бути передбачено конструкцією.</td></tr><tr><td>Розміри</td><td>Д103 x Ш61 x В37 мм</td><td>Д100 x Ш57 x В22 мм</td></tr><tr><td>Вага</td><td>198 г</td><td>89 г</td></tr><tr><td>Температура середовища</td><td>-40°C-..+50°C</td><td>-40°C-..+50°C</td></tr></tbody></table><h2 id="основні-характеристики-1" tabindex="-1">Основні характеристики <a class="header-anchor" href="#основні-характеристики-1" aria-label="Permalink to &quot;Основні характеристики&quot;">​</a></h2><ul><li><p><strong>Простий монтаж</strong></p><p><img src="'+i+'" alt="Простий монтаж"></p></li><li><p><strong>FPV-камера входить до стандартної комплектації</strong></p><p><img src="'+a+'" alt="FPV-камера входить до стандартної комплектації"></p></li></ul><h2 id="інтерфеиси" tabindex="-1">Інтерфейси <a class="header-anchor" href="#інтерфеиси" aria-label="Permalink to &quot;Інтерфейси&quot;">​</a></h2><h3 id="лівии-бік" tabindex="-1">Лівий бік <a class="header-anchor" href="#лівии-бік" aria-label="Permalink to &quot;Лівий бік&quot;">​</a></h3><p><img src="'+o+'" alt="Ліва сторона"></p><ul><li><p><strong>Інтерфейси зліва:</strong></p><ul><li>Вхід живлення з контролем напруги та струму</li><li>Місійний комп&#39;ютер зі ШІ з картою пам&#39;яті micro SD</li><li>Карта micro SD для польотного контролера</li><li>Місійний комп&#39;ютер зі ШІ USB Type-C</li><li>Вхід PPM, вихід SBUS, монітор RSSI</li></ul></li><li><p><strong>Живлення - JST GH SM10B-GHS-TB</strong></p><table><thead><tr><th>Номер виводу</th><th>Назва виводу</th><th>Напрямок</th><th>Напруга</th><th>Функція</th></tr></thead><tbody><tr><td>1</td><td>12V</td><td>IN</td><td>+12В</td><td>Основний вхід живлення</td></tr><tr><td>2</td><td>12V</td><td>IN</td><td>+12В</td><td>Основний вхід живлення</td></tr><tr><td>3</td><td>12V</td><td>IN</td><td>+12В</td><td>Основний вхід живлення</td></tr><tr><td>4</td><td>BAT_CURRENT</td><td>IN</td><td>+3.3В</td><td>Моніторинг струму акумулятора</td></tr><tr><td>5</td><td>BAT_VOLTAGE</td><td>IN</td><td>+3.3В</td><td>Моніторинг напруги акумулятора</td></tr><tr><td>6</td><td>3V3</td><td>OUT</td><td>+3.3В</td><td>Вихід 3.3В</td></tr><tr><td>7</td><td>PWR_KEY</td><td>IN</td><td>+3.3В</td><td>Вхід клавіші живлення</td></tr><tr><td>8</td><td>GND</td><td>Заземлення</td><td></td><td></td></tr><tr><td>9</td><td>GND</td><td>Заземлення</td><td></td><td></td></tr><tr><td>10</td><td>GND</td><td>Заземлення</td><td></td><td></td></tr></tbody></table></li><li><p><strong>Карта пам&#39;яті процесора - microSD</strong></p></li><li><p><strong>CPU USB - USB Type C</strong></p></li><li><p><strong>Роз&#39;єм RC - JST GH SM06B-GHS-TB</strong></p><table><thead><tr><th>Номер виводу</th><th>Назва виводу</th><th>Напрямок</th><th>Напруга</th><th>Функція</th></tr></thead><tbody><tr><td>1</td><td>5V</td><td>OUT</td><td>+5В</td><td>Вихід 5В</td></tr><tr><td>2</td><td>PPM_IN</td><td>IN</td><td>+3.3В</td><td>PPM вхід</td></tr><tr><td>3</td><td>RSSI_IN</td><td>IN</td><td>+3.3В</td><td>RSSI вхід</td></tr><tr><td>4</td><td>FAN_OUT</td><td>OUT</td><td>+5В</td><td>Вихід вентилятора</td></tr><tr><td>5</td><td>SBUS_OUT</td><td>OUT</td><td>+3.3В</td><td>SBUS вихід</td></tr></tbody></table></li></ul><ul><li><strong>FMU SD карта - microSD</strong></li></ul><h3 id="правии-бік" tabindex="-1">Правий бік <a class="header-anchor" href="#правии-бік" aria-label="Permalink to &quot;Правий бік&quot;">​</a></h3><p><img src="'+n+'" alt="Права сторона"></p><ul><li><p><strong>Інтерфейси справа:</strong></p><ul><li>Ethernet-порт з виходом живлення</li><li>Телеметричний порт</li><li>Другий GPS-порт</li><li>Запасний порт I2C / UART</li><li>Польотний контролер USB Type-C</li><li>Мікро SIM-карта</li><li>Вхідний порт HDMI (камера корисного навантаження)</li></ul></li><li><p><strong>ETHERNET - JST GH SM08B-GHS-TB</strong></p><table><thead><tr><th>Номер виводу</th><th>Назва виводу</th><th>Напрямок</th><th>Напруга</th><th>Функція</th></tr></thead><tbody><tr><td>1</td><td>5V</td><td>OUT</td><td>+5В</td><td>Блок живлення радіомодуля</td></tr><tr><td>2</td><td>5V</td><td>OUT</td><td>+5В</td><td>Блок живлення радіомодуля</td></tr><tr><td>3</td><td>ETH_TXP</td><td>OUT</td><td>+3.3В</td><td>Передача позитивного сигналу Ethernet</td></tr><tr><td>4</td><td>ETH_TXN</td><td>OUT</td><td>+3.3В</td><td>Передача негативного сигналу Ethernet</td></tr><tr><td>5</td><td>ETH_RXP</td><td>IN</td><td>+3.3В</td><td>Отримання позитивного сигналу Ethernet</td></tr><tr><td>6</td><td>ETH_RXN</td><td>IN</td><td>+3.3В</td><td>Отримання негативного сигналу Ethernet</td></tr><tr><td>7</td><td>GND</td><td>Заземлення</td><td></td><td></td></tr><tr><td>8</td><td>GND</td><td>Заземлення</td><td></td><td></td></tr></tbody></table></li><li><p><strong>TEL3 - JST GH SM06B-GHS-TB</strong></p><table><thead><tr><th>Номер виводу</th><th>Назва виводу</th><th>Напрямок</th><th>Напруга</th><th>Функція</th></tr></thead><tbody><tr><td>1</td><td>5V</td><td>OUT</td><td>+5В</td><td>Вихід джерела живлення</td></tr><tr><td>2</td><td>USART2_TX</td><td>OUT</td><td>+3.3В</td><td>Телеметрія 3 TX</td></tr><tr><td>3</td><td>USART2_RX</td><td>IN</td><td>+3.3В</td><td>Телеметрія 3 RX</td></tr><tr><td>4</td><td>USART2_CTS</td><td>IN</td><td>+3.3В</td><td>Телеметрія 3 CTS</td></tr><tr><td>5</td><td>USART2_RTS</td><td>OUT</td><td>+3.3В</td><td>Телеметрія 3 RTS</td></tr><tr><td>6</td><td>GND</td><td>Заземлення</td><td></td><td></td></tr></tbody></table></li><li><p><strong>I2C3 / UART4 - JST GH SM06B-GHS-TB</strong></p><table><thead><tr><th>Номер виводу</th><th>Назва виводу</th><th>Напрямок</th><th>Напруга</th><th>Функція</th></tr></thead><tbody><tr><td>1</td><td>5V</td><td>OUT</td><td>+5В</td><td>Вихід джерела живлення</td></tr><tr><td>2</td><td>USART4_TX</td><td>OUT</td><td>+3.3В</td><td>UART 4 TX</td></tr><tr><td>3</td><td>USART4_RX</td><td>IN</td><td>+3.3В</td><td>UART 4 RX</td></tr><tr><td>4</td><td>I2C3_SCL</td><td>I/O</td><td>+3.3В</td><td>Годинник I2C3</td></tr><tr><td>5</td><td>I2C3_SDA</td><td>I/O</td><td>+3.3В</td><td>Дані I2C3</td></tr><tr><td>6</td><td>GND</td><td>Заземлення</td><td></td><td></td></tr></tbody></table></li><li><p><strong>GPS2 - JST GH SM06B-GHS-TB</strong></p><table><thead><tr><th>Номер виводу</th><th>Назва виводу</th><th>Напрямок</th><th>Напруга</th><th>Функція</th></tr></thead><tbody><tr><td>1</td><td>5V</td><td>OUT</td><td>+5В</td><td>Вихід джерела живлення</td></tr><tr><td>2</td><td>USART8_TX</td><td>OUT</td><td>+3.3В</td><td>UART 8 TX</td></tr><tr><td>3</td><td>USART8_RX</td><td>IN</td><td>+3.3В</td><td>UART 8 RX</td></tr><tr><td>4</td><td>I2C2_SCL</td><td>I/O</td><td>+3.3В</td><td>Годинник I2C2</td></tr><tr><td>5</td><td>I2C2_SDA</td><td>I/O</td><td>+3.3В</td><td>Дані I2C2</td></tr><tr><td>6</td><td>GND</td><td>Заземлення</td><td></td><td></td></tr></tbody></table></li><li><p><strong>FMU USB - USB Type C</strong></p></li><li><p><strong>SIM Card - micro SIM</strong></p></li><li><p><strong>HDMI - mini HDMI</strong></p></li></ul><h3 id="лицьова-сторона" tabindex="-1">Лицьова сторона <a class="header-anchor" href="#лицьова-сторона" aria-label="Permalink to &quot;Лицьова сторона&quot;">​</a></h3><p><img src="'+s+'" alt="Лицьова сторона"></p><ul><li><p><strong>Інтерфейси спереду:</strong></p><ul><li>Основний порт GNSS і компаса</li><li>Основний телеметричний порт</li><li>Вхід для камери CSI</li><li>CAN 1</li><li>CAN 2</li></ul></li><li><p><strong>TEL1 - JST GH SM06B-GHS-TB</strong></p><table><thead><tr><th>Номер виводу</th><th>Назва виводу</th><th>Напрямок</th><th>Напруга</th><th>Функція</th></tr></thead><tbody><tr><td>1</td><td>5V</td><td>OUT</td><td>+5В</td><td>Вихід джерела живлення</td></tr><tr><td>2</td><td>USART7_TX</td><td>OUT</td><td>+3.3В</td><td>Телеметрія 1 TX</td></tr><tr><td>3</td><td>USART7_RX</td><td>IN</td><td>+3.3В</td><td>Телеметрія 1 RX</td></tr><tr><td>4</td><td>USART7_CTS</td><td>IN</td><td>+3.3В</td><td>Телеметрія 1 CTS</td></tr><tr><td>5</td><td>USART7_RTS</td><td>OUT</td><td>+3.3В</td><td>Телеметрія 1 RTS</td></tr><tr><td>6</td><td>GND</td><td>Заземлення</td><td></td><td></td></tr></tbody></table></li><li><p><strong>GPS1 - JST GH SM10B-GHS-TB</strong></p><table><thead><tr><th>Номер виводу</th><th>Назва виводу</th><th>Напрямок</th><th>Напруга</th><th>Функція</th></tr></thead><tbody><tr><td>1</td><td>5V</td><td>OUT</td><td>+5В</td><td>Вихід джерела живлення</td></tr><tr><td>2</td><td>USART1_TX</td><td>OUT</td><td>+3.3В</td><td>GPS 1 TX</td></tr><tr><td>3</td><td>USART1_RX</td><td>IN</td><td>+3.3В</td><td>GPS 1 RX</td></tr><tr><td>4</td><td>І2C1_SCL</td><td>I/O</td><td>+3.3В</td><td>Годинник Mag 1</td></tr><tr><td>5</td><td>I2C1_SDA</td><td>I/O</td><td>+3.3В</td><td>Дані Mag 1</td></tr><tr><td>6</td><td>SAFETY_BTN</td><td>IN</td><td>+3.3В</td><td>Кнопка безпеки</td></tr><tr><td>7</td><td>SAFETY_LED</td><td>OUT</td><td>+3.3В</td><td>Індикатор безпеки</td></tr><tr><td>8</td><td>+3V3</td><td>OUT</td><td>+3.3В</td><td>Вихід 3.3В</td></tr><tr><td>9</td><td>BUZZER</td><td>OUT</td><td>+5В</td><td>Вихід зумера</td></tr><tr><td>10</td><td>GND</td><td>Заземлення</td><td></td><td></td></tr></tbody></table></li><li><p><strong>CAN1 - JST GH SM04B-GHS-TB</strong></p><table><thead><tr><th>Номер виводу</th><th>Назва виводу</th><th>Напрямок</th><th>Напруга</th><th>Функція</th></tr></thead><tbody><tr><td>1</td><td>5V</td><td>OUT</td><td>+5В</td><td>Вихід джерела живлення</td></tr><tr><td>2</td><td>CAN1_H</td><td>I/O</td><td>+5В</td><td>CAN 1 High (120Ω)</td></tr><tr><td>3</td><td>CAN1_L</td><td>I/O</td><td>+5В</td><td>CAN 1 Low (120Ω)</td></tr><tr><td>4</td><td>GND</td><td>Заземлення</td><td></td><td></td></tr></tbody></table></li><li><p><strong>CAN2 - JST GH SM04B-GHS-TB</strong></p><table><thead><tr><th>Номер виводу</th><th>Назва виводу</th><th>Напрямок</th><th>Напруга</th><th>Функція</th></tr></thead><tbody><tr><td>1</td><td>5V</td><td>OUT</td><td>+5В</td><td>Вихід джерела живлення</td></tr><tr><td>2</td><td>CAN2_H</td><td>I/O</td><td>+5В</td><td>CAN 2 High (120Ω)</td></tr><tr><td>3</td><td>CAN2_L</td><td>I/O</td><td>+5В</td><td>CAN 2 Low (120Ω)</td></tr><tr><td>4</td><td>GND</td><td>Заземлення</td><td></td><td></td></tr></tbody></table></li><li><p><strong>CAMERA - FPC 30 pin, 0.5mm pitch</strong></p></li></ul><h3 id="задня-сторона" tabindex="-1">Задня сторона <a class="header-anchor" href="#задня-сторона" aria-label="Permalink to &quot;Задня сторона&quot;">​</a></h3><p><img src="'+h+'" alt="Задня сторона"></p><ul><li><p><strong>Інтерфейси ззаду:</strong></p><ul><li>Вхід SBUS</li><li>16 вихідних каналів ШІМ</li><li>2 гнізда для антен LTE (MIMO)</li><li>Гніздо для антени WiFi (режими точки доступу та станції)</li></ul></li></ul><h1 id="серіине-мапування" tabindex="-1">Серійне мапування <a class="header-anchor" href="#серіине-мапування" aria-label="Permalink to &quot;Серійне мапування&quot;">​</a></h1><p>AIRLink має велику кількість внутрішніх і зовнішніх послідовних портів:</p><table><thead><tr><th>Серія</th><th>UART</th><th>Функція</th></tr></thead><tbody><tr><td>Серія 0</td><td>USB</td><td>Консоль</td></tr><tr><td>Серія 1</td><td>UART 7</td><td>Телеметрія 1</td></tr><tr><td>Серія 2</td><td>UART 5</td><td>Телеметрія 2 (використовується всередині комп&#39;ютера місії)</td></tr><tr><td>Серія 3</td><td>USART 1</td><td>GPS 1</td></tr><tr><td>Серія 4</td><td>UART 8</td><td>GPS 2</td></tr><tr><td>Серія 5</td><td>USART 3</td><td>Консоль відладки (внутрішній роз&#39;єм)</td></tr><tr><td>Серія 6</td><td>USART 2</td><td>Телеметрія 3</td></tr><tr><td>Серія 7</td><td>UART 4</td><td>Зовнішній UART</td></tr></tbody></table><h2 id="rc-вхід" tabindex="-1">RC-вхід <a class="header-anchor" href="#rc-вхід" aria-label="Permalink to &quot;RC-вхід&quot;">​</a></h2><p>RC-вхід конфігурується на виводі SBUS і підключається до IO MCU через внутрішній інвертор. Для PPM-приймачів, будь ласка, використовуйте штифт PPM роз&#39;єму RC, розташований на лівій стороні пристрою.</p><p><img src="'+p+'" alt="RC-вхід"></p><h2 id="виходи" tabindex="-1">Виходи <a class="header-anchor" href="#виходи" aria-label="Permalink to &quot;Виходи&quot;">​</a></h2><p>AIRLink має 16 ШІМ-виходів. Основні виходи 1-8 і підключені до IO MCU. Виходи AUX 1-8 підключено до FMU.</p><table><thead><tr><th>Вивід</th><th>Таймер</th><th>Канал</th></tr></thead><tbody><tr><td>AUX 1</td><td>Timer 1</td><td>Channel 4</td></tr><tr><td>AUX 2</td><td>Timer 1</td><td>Channel 3</td></tr><tr><td>AUX 3</td><td>Timer 1</td><td>Channel 2</td></tr><tr><td>AUX 4</td><td>Timer 1</td><td>Channel 1</td></tr><tr><td>AUX 5</td><td>Timer 4</td><td>Channel 2</td></tr><tr><td>AUX 6</td><td>Timer 4</td><td>Channel 3</td></tr><tr><td>AUX 7</td><td>Timer 12</td><td>Channel 1</td></tr><tr><td>AUX 8</td><td>Timer 12</td><td>Channel 2</td></tr></tbody></table><p><a href="./../peripherals/dshot.html">DShot</a> можна використовувати на перших чотирьох контактах AUX.</p><h2 id="збірка-прошивки" tabindex="-1">Збірка прошивки <a class="header-anchor" href="#збірка-прошивки" aria-label="Permalink to &quot;Збірка прошивки&quot;">​</a></h2><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>Більшості користувачів не потрібно збирати цю прошивку! Він попередньо створений і автоматично встановлюється за допомогою <em>QGroundControl</em> при підключенні відповідного обладнання.</p></div><p>Щоб <a href="./../dev_setup/building_px4.html"> зібрати PX4</a> для цієї цілі:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code"><code><span class="line"><span>make sky-drones_smartap-airlink</span></span></code></pre></div><h2 id="периферія" tabindex="-1">Периферія <a class="header-anchor" href="#периферія" aria-label="Permalink to &quot;Периферія&quot;">​</a></h2><ul><li><a href="./../gps_compass/gps_smartap.html">SmartAP GPS</a> - GPS-модуль з компасом, датчиком тиску та RGB-світлодіодом</li><li><a href="./../power_module/sky-drones_smartap-pdb.html">SmartAP PDB</a> - плата розподілу живлення</li></ul><h2 id="еталоннии-проєкт" tabindex="-1">Еталонний проєкт <a class="header-anchor" href="#еталоннии-проєкт" aria-label="Permalink to &quot;Еталонний проєкт&quot;">​</a></h2><p><img src="'+c+'" alt="Еталонний проєкт"></p><p>CAD модель AIRLink доступна <a href="https://docs.sky-drones.com/airlink/cad-model" target="_blank" rel="noreferrer">тут</a></p><p>Еталонний дизайн AIRLink може бути наданий за запитом. Зв&#39;яжіться з нами на <a href="https://sky-drones.com/contact-us" target="_blank" rel="noreferrer">контактній сторінці Sky-Drones</a>.</p><h2 id="докладніше" tabindex="-1">Докладніше <a class="header-anchor" href="#докладніше" aria-label="Permalink to &quot;Докладніше&quot;">​</a></h2><p>Для отримання додаткової інформації та інструкцій щодо налаштування та використання системи AIRLink див. <a href="https://docs.sky-drones.com/airlink/" target="_blank" rel="noreferrer">Документація AIRLink</a>.</p><p>Для технічної допомоги, підтримки та налаштування, будь ласка, зв&#39;яжіться з нами на <a href="https://sky-drones.com/contact-us" target="_blank" rel="noreferrer">Контактній сторінці Sky-Drones</a>.</p><p>Більше інформації можна знайти на <a href="https://sky-drones.com" target="_blank" rel="noreferrer">www.sky-drones.com</a>.</p><p>Відповіді на поширені запитання можна знайти в розділі <a href="https://docs.sky-drones.com/airlink/faq" target="_blank" rel="noreferrer">FAQ</a>.</p><h2 id="корисні-посилання" tabindex="-1">Корисні посилання <a class="header-anchor" href="#корисні-посилання" aria-label="Permalink to &quot;Корисні посилання&quot;">​</a></h2><ul><li><a href="https://sky-drones.com/airlink" target="_blank" rel="noreferrer">Сторінка продукту AIRLink</a></li><li><a href="https://docs.sky-drones.com/avionics/airlink" target="_blank" rel="noreferrer">Документація AIRLink</a></li><li><a href="https://3182378893-files.gitbook.io/~/files/v0/b/gitbook-x-prod.appspot.com/o/spaces%2F-MTMlWysgDtJq8Hid1v7%2Fuploads%2F8AiuNNSwLYnZSscj7uIV%2FAIRLink-Datasheet.pdf?alt=media&amp;token=cbf0c4bf-9ab1-40c5-a0af-c6babdddb690" target="_blank" rel="noreferrer">Технічна специфікація AIRLink</a></li><li><a href="https://sky-drones.com/sets/airlink-enterprise-set.html" target="_blank" rel="noreferrer">Придбання AIRLink Enterprise 4G</a></li><li><a href="https://sky-drones.com/sets/airlink-5g-enterprise-set.html" target="_blank" rel="noreferrer">Придбання AIRLink Enterprise 5G</a></li><li><a href="https://sky-drones.com/autopilots/airlink-core.html" target="_blank" rel="noreferrer">Придбання AIRLink Core 4G</a></li><li><a href="https://sky-drones.com/store/airlink-5g-core.html" target="_blank" rel="noreferrer">Придбання AIRLink Core 5G</a></li></ul>',56),g=[_,S,A,u,I];function R(C,f,U,P,y,L){return m(),k("div",null,g)}const x=T(b,[["render",R]]);export{M as __pageData,x as default};
